Defines global error codes for error_t in TinyOS.

Initialize this component. Initialization should not assume that
any component is running: init() cannot call any commands besides
those that initialize other components.  

@return SUCCESS if initialized properly, FAIL otherwise.
@see TEP 107: Boot Sequence

Interface that notifies components when TinyOS has booted
(initialized all of its components), as discussed in TEP 107.

@author Philip Levis
@date   January 5 2005

Signaled when the system has booted successfully. Components can
assume the system has been initialized properly. Services may
need to be started to work, however.

@see StdControl
@see SplitConrol
@see TEP 107: Boot Sequence

Convert n microseconds into a value suitable for use with
AlarmMicro32C Alarms.
@param n Time in microseconds.
@return AlarmMicro argument that best approximates n microseconds.

Convert values used by AlarmMicro32C Alarms into actual microseconds.
@param n A time expressed in AlarmMicro time units.
@return Time in microseconds that corresponds to AlarmMicro argument n.

Return the smallest ADC prescaler value which guaranteers full
ADC precision.
@return ADC prescaler value.

Clients of the higher-level A/D system must implement this interface to
specify which channel to sample, and with what parameters.

@author David Gay

Obtain reference voltage
@return The reference voltage to use. Must be one of the 
  ATM128_ADC_VREF_xxx values from Atm128Adc.h.

Obtain channel.
@return The A/D channel to use. Must be one of the ATM128_ADC_SNGL_xxx
  or ATM128_ADC_DIFF_xxx values from Atm128Adc.h.

Obtain prescaler value.
@return The prescaler value to use. Must be one of the 
  ATM128_ADC_PRESCALE_xxx values from Atm128Adc.h.

